import React from "react";
import { Component } from "react";

import blog from "./images/blog.jpg";
import diary from "./images/diary.jpg";
import laptop from './images/laptop.jpg';
import web_design from './images/web-design.jpg';


const Carousel = () => {
    return (
        <div id="carousel" className="carousel slide" data-bs-ride="carousel">
            <div className="carousel-inner">
                <div className="carousel-item active" data-bs-interval="3000">
                    <img className="d-block w-100" src={blog} alt="First slide" />
                </div>

                <div className="carousel-item" data-bs-interval="3000">
                    <img className="d-block w-100" src={diary} alt="Second slide" />
                </div>

                <div className="carousel-item" data-bs-interval="3000">
                    <img className="d-block w-100" src={laptop} alt="Third slide" />
                </div>

                <div className="carousel-item" data-bs-interval="3000">
                    <img className="d-block w-100" src={web_design} alt="Fourth slide" />
                </div>

            </div>

        </div>
    )
}

export default Carousel
